const DUMMY = [
  { id: "p1", title: "sandeep" },
  { id: "p2", title: "bhavna" },
  { id: "p3", title: "tanvi" },
];

export default function EventPage() {
  return (
    <>
      <h1>eventpage</h1>
      <ul>
        {DUMMY.map((event) => <li key={event.id}></li>)}
      </ul>
    </>
  );
}
